import React, {Component} from 'react';
class Login extends Component{
  render(){
    return (
      <div >
        <button style={{marginTop: "150px",margin:"50px"}} className="btn btn-info" >Sign In</button>
        <button style={{marginTop: "150px",margin:"50px"}} className="btn btn-light" >Sign Up</button>
      </div>
    );
  }
}

export default Login;
